import React from 'react'


function Info() {
    const user = JSON.parse(localStorage.getItem('user'));
    return (
        <div>
            <p>name: {user.name}</p>
            <p>phone: {user.phone}</p>
            <p>email: {user.email}</p>
            <p>address: {user.address.city + " " + user.address.street}</p>
        </div>
    )
}
export default Info;
